    function handleClick (e) {
        setIndexCrew(e.target.id)
    }

    return  <div className="crew h-auto lg:h-screen">
                <NavBar active="crew" />
                <TechnologyVehicle handleClick={handleClick} data={crewData} indexCrew={indexCrew} />
            </div>
}
